        - dns.msftnsci.com
        - www.msftnsci.com
        - www.msftconnecttest.com
    default-nameserver:
        - 114.114.114.114
        - 8.8.8.8
    proxy-server-nameserver:
        - https://223.5.5.5/dns-query
        - https://doh.pub/dns-query
ntp:
    server: time.apple.com
    port: 123
    interval: 30
tun:
